import { useState } from 'react'
import './Form.css'
function Form({ searchTerm, setSearchTerm }){
   
    let eventHandler= (e) =>{
      setSearchTerm(e.target.value)

    }
    return(
        <form  className="form-header" onSubmit={(e) => e.preventDefault()}>
            <input onChange={eventHandler} className="input-header"  type="search" placeholder="search"   value={searchTerm} />
        </form>
    )
}
export default Form
